import { HttpClient, HttpHeaders } from '@angular/common/http';
import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { Pais } from './Pais';

@Component({
  selector: 'app-patchPais',
  templateUrl: './patchPais.component.html',
  styleUrls: ['./patchPais.component.css']
})
export class patchPaisComponent {

  pais: string="";
  provincia: any;
  constructor(private router: Router, private http: HttpClient) {
  }


  patchPais() {
    let _headers = new HttpHeaders({
      'Content-Type': 'application/json',
    });

    let data: Pais = {
     nombre: this.pais,
     provincia: this.ciudades,
    }

    console.log(data);

    this.http.patch("/paises/" + this.pais, data, { headers: _headers }).subscribe(
      response => {      
        console.log("Exito", response);
      },
      error => { 
        console.log(":(", error); 
      }
    )
  }
}
